/** Returns true iff a file with the given name exists. */
@Override
public boolean fileExists(String name) {
  ensureOpen();
  if (this.writer != null) {
    return writer.fileExists(name);
  }
  return entries.containsKey(IndexFileNames.stripSegmentName(name));
}

